import React, { Component } from 'react'

class UserDetails extends Component {
  render() {
    return(
      <div>
        <ul>
          <li > Profile Details </li>
          <li > Bio </li>
          <li > Your Arts </li>
          <li > Followers </li>
        </ul>
      </div>
    )
  }
}
export default UserDetails
